import {Note} from './Note'






function App({notes = []}) {
    if(!notes){
        return 'No hay notas'
    }

    return ( 
        <ol>
            {notes.map((note) => <Note key={note.id} {...note}/>)}
        </ol>
    )
}


export default App;
